##############################################################################
# Mutable Data
##############################################################################
# Active capsule state
active_capsule_row_left:     .word 0
active_capsule_row_right:    .word 0
active_capsule_col_left:     .word 0
active_capsule_col_right:    .word 0
active_capsule_orientation:  .word 0   # 0 = horizontal, 1 = vertical

# Game over flag
game_over_flag:              .word 0   # 0 = game continues, 1 = game over
paused_flag: 	            .word 0   # 0 = game continues, 1 = game paused

# Capsule colors
capsule_color_left:       .word 0
capsule_color_right:      .word 0

# Player score
